import React, { useState , useEffect } from 'react'

const [data, setData] = useState([{}])

    useEffect(() => {
    fetch("/agents").then(
      res => res.json()
    ).then(
      agents => {
        setData(agents)
        console.log(agents)
        console.log(typeof agents)
        for (const agent in agents) {
            console.log(`${agent}: ${agents[agent]}`);
        }
      }
    )
  }, []) 

